import React from 'react';
import MediaQuery from 'react-responsive';
import theme from '../theme/theme';
import video from '../images/background.mov'
import { makeStyles } from '@material-ui/core/styles';
import cutout from '../images/Cutout.png';

import { CardMedia, Card, CardActionArea } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
    div: {
        position: "relative",
      },
      backgroundImage: {
        width: "100%",
        height: "100%",
      },
      cutoutImage: {
        position: "absolute",
        top: "65%",
        left: "35%",
        transform: "translate(-50%, -50%)",
        width: "70%"
      }
}));

export default function App() {

    const classes = useStyles();

    return (
        <div>
            <MediaQuery minWidth={theme.breakpoints.values.iPhone678Plus}>
                <Card raised={true}>
                    <div className={classes.div}>
                        <CardActionArea>
                            <CardMedia component='video' image={video} autoPlay loop muted />
                        </CardActionArea>
                        <img src={cutout} alt="" className={classes.cutoutImage} gutterBottom={true}/>
                    </div>
                </Card>
            </MediaQuery>

        </div>
    )
}
